    false,nt"url": null,nt"notes": "This report presents the results of the
    soil and sediment analysis activities performed at Modoc  National Wildlife Refuge
    (Refuge), located in Alturas, Modoc County, California. This report  has been prepared
    in accordance with Ninyo & Moore's proposal to GeoEngineers, Inc. dated  September
    15, 2000.  The objective of the soil and sediment analysis was to assess if there
    have been any significant  releases of chemical constituents into underlying soils
    from potential chemical source areas of  concern lying adjacent to the Refuge. The
    site description, scope of services, analytical results,  conclusions, and limitations
    are provided in the following sections of this report.",nt"license_title":
